import React, { Component } from "react";
import {Alert, Card, Form, Profile} from 'tabler-react';

class AppProfile extends React.Component {
    render() {
        return (
        <div className="dashboard">
            <Card>
                <Card.Status color="blue" side />
                <Card.Header>
                    <Card.Title>Profile</Card.Title>
                </Card.Header>
                <Card.Body>
                    <Form>    
                        <Form.Input name="username" label="Username" disabled value="Jacob"/>
                        <Form.Input name="firstname" label="First Name" isInline/>
                        <Form.Input name="lastname" label="Last Name" isInline/>
                        <Form.Input name="email" label="E-Mail" disabled />
                        <Form.Input name="phone" label="Phone Number" mask=".*" disabled value="0568045685"/>
                        <Form.Radio/>
                    </Form>
                </Card.Body>
            </Card>
        </div>
        )
    }
}

export default AppProfile;
